import React, { Component } from "react";
const ModelViewer = require("../../assets/images/metamask.svg");

export default class MetaViewer extends Component {
  render() {
    const viewer = ModelViewer({
      // Dictates whether width & height are px or multiplied
      pxNotRatio: true,
      width: 500,
      height: 400,
      // pxNotRatio: false,
      // width: 0.9,
      // height: 0.9,

      // To make the face follow the mouse.
      followMouse: false,

      // head should slowly drift (overrides lookAt)
      slowDrift: false,
    });
  }
}
